import React from "react";
import Products from "../components/Products";

function ProductPage() {
  return (
    <>

      <section className="flex flex-col w-full h-auto">
        <div className="absolute w-full h-[200px] flex top-0 z-0 pt-[72px] opacity-50">
          <img src="/attachment/pic4.jpg" alt="" className="absolute object-cover h-full object-center w-full mask-t-from-50% mt-10" />
        </div>

        <div className="flex h-[200px] w-full outline z-10 top-0 left-0">
          <span className="flex w-full h-full items-center justify-center font-bold text-3xl text-white uppercase text-stroke">
            OUR PRODUCT
          </span>
        </div>

        <div className="flex h-[200px] w-full outline z-10 top-0 left-0">
          <span className="flex w-full h-full items-center justify-center font-bold text-3xl uppercase">
            OUR PRODUCT
          </span>
        </div>

      </section>
    </>
  );
}

export default ProductPage;
